import React , { Component } from 'react';
import { BrowserRouter, Route, Link } from "react-router-dom";

class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            playerHealth: 100,
            playerAttack: 2,
        }
    }

    render() {
        return(
            <nav>
            <h1>This is the homepage</h1>
            <ul>
                <li>
                    <Link to="/GameBoard">Return to room one</Link>
                </li>
            </ul>
        </nav>
        )
    }
}

export default Home;
